import React from "react";

import Button from "../UI/Button/Button";
import classes from "./MountainCard.module.css";

const MountainCard = () => {
  return (
    <li className={classes.onemountain}>
      <div>
        <h1>name</h1>
        <h3>height</h3>
        <Button />
      </div>
    </li>
  );
};

export default MountainCard;
